import axios from "axios";
const baseUrl = process.env.REACT_APP_API_URL;


export async function getTextAPI(korean:string) {
    try{
        const { data } = await axios ({
            method:" GET",
            url: `${baseUrl}/book/papago`,
            data: korean
        });
        return data;
    }catch(e) {
        console.log(e)
    }
}
